// ScripTV HTML Handler
// 该脚本用于 Loon/Surge 等工具拦截 www.scrip.tv 请求并返回前端页面

const htmlBase64 = ""
const html = decodeURIComponent(escape(atob(htmlBase64)));
$done({
    response: {
        status: 200,
        headers: {
            "Content-Type": "text/html; charset=utf-8"
        },
        body: html
    }
});
